// HasLcmClient applies the HasEdge predicate on the "lcm_client" edge.
func HasLcmClient() predicate.LcmCa {
	return predicate.LcmCa(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2O, true, LcmClientTable, LcmClientColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasLcmClientWith applies the HasEdge predicate on the "lcm_client" edge with a given conditions (other predicates).
func HasLcmClientWith(preds ...predicate.LcmClient) predicate.LcmCa {
	return predicate.LcmCa(func(s *sql.Selector) {
		step := newLcmClientStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.LcmCa) predicate.LcmCa {
	return predicate.LcmCa(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.LcmCa) predicate.LcmCa {
	return predicate.LcmCa(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.LcmCa) predicate.LcmCa {
	return predicate.LcmCa(sql.NotPredicates(p))
}
